INSERT INTO `v1_30bbf4351bf0ffede57330108466f32d07896de0833ab983ec2ba956ed35792b` VALUES ("ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", "ヤマト", 130011, 3001100, 1, 2.1, "2024/10/31 12:00:00", "2030/01/01 14:59:59", 100, 0.0, 3001, -416.5, 2);
INSERT INTO `v1_30bbf4351bf0ffede57330108466f32d07896de0833ab983ec2ba956ed35792b` VALUES ("他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか", "ヤマト", 130011, 3001101, 4, 5.68, "2024/10/31 12:00:00", "2030/01/01 14:59:59", 101, 0.0, 3001, -416.5, 2);
INSERT INTO `v1_30bbf4351bf0ffede57330108466f32d07896de0833ab983ec2ba956ed35792b` VALUES ("なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。", "ヤマト", 130011, 3001102, 1, 0.0, "2024/10/31 12:00:00", "2030/01/01 14:59:59", 102, 0.0, 3001, -416.5, 1);
INSERT INTO `v1_30bbf4351bf0ffede57330108466f32d07896de0833ab983ec2ba956ed35792b` VALUES ("え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", "フブキ", 130211, 3002100, 1, 0.0, "2024/10/31 12:00:00", "2030/01/01 14:59:59", 100, 0.0, 3002, -416.5, 1);
INSERT INTO `v1_30bbf4351bf0ffede57330108466f32d07896de0833ab983ec2ba956ed35792b` VALUES ("ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡", "フブキ", 130211, 3002101, 1, 0.0, "2024/10/31 12:00:00", "2030/01/01 14:59:59", 101, 0.0, 3002, -416.5, 1);
INSERT INTO `v1_30bbf4351bf0ffede57330108466f32d07896de0833ab983ec2ba956ed35792b` VALUES ("へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ", "フブキ", 130211, 3002102, 5, 8.53, "2024/10/31 12:00:00", "2030/01/01 14:59:59", 102, 0.0, 3002, -416.5, 2);
INSERT INTO `v1_30bbf4351bf0ffede57330108466f32d07896de0833ab983ec2ba956ed35792b` VALUES ("なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？", "フブキ", 130211, 3002103, 7, 5.67, "2024/10/31 12:00:00", "2030/01/01 14:59:59", 103, 0.0, 3002, -416.5, 1);
INSERT INTO `v1_30bbf4351bf0ffede57330108466f32d07896de0833ab983ec2ba956ed35792b` VALUES ("ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？", "フブキ", 130211, 3002104, 1, 0.0, "2024/10/31 12:00:00", "2030/01/01 14:59:59", 104, 0.0, 3002, -416.5, 1);
INSERT INTO `v1_30bbf4351bf0ffede57330108466f32d07896de0833ab983ec2ba956ed35792b` VALUES ("あのさーザコお兄さん、\nな～んか調子乗ってない？\nぼくのこと、なんでもくれる\nチョロいやつとか思ってたりー？", "フブキ", 130211, 3002300, 3, 0.0, "2024/10/31 12:00:00", "2030/01/01 14:59:59", 300, 0.0, 3004, -416.5, 3);
INSERT INTO `v1_30bbf4351bf0ffede57330108466f32d07896de0833ab983ec2ba956ed35792b` VALUES ("ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡", "フブキ", 130211, 3002400, 7, 0.0, "2024/10/31 12:00:00", "2030/01/01 14:59:59", 301, 0.0, 3005, -416.5, 7);
INSERT INTO `v1_30bbf4351bf0ffede57330108466f32d07896de0833ab983ec2ba956ed35792b` VALUES ("きゃはは、ほんと必死～♡\nは～、面白かった。\n笑えたからいいよ～\nそれ、恵んだげる～♪", "フブキ", 130211, 3003200, 2, 4.4, "2024/10/31 12:00:00", "2030/01/01 14:59:59", 200, 0.0, 3003, -416.5, 1);
INSERT INTO `v1_30bbf4351bf0ffede57330108466f32d07896de0833ab983ec2ba956ed35792b` VALUES ("は～、しょうがないな～♡\nザコお兄さんってば\nほんとよわよわで\n情けないよね～ｗ", "フブキ", 130211, 3003201, 7, 0.0, "2024/10/31 12:00:00", "2030/01/01 14:59:59", 201, 0.0, 3003, -416.5, 7);
INSERT INTO `v1_30bbf4351bf0ffede57330108466f32d07896de0833ab983ec2ba956ed35792b` VALUES ("お兄さんってば、ぼくがいないと\nほんとザッコザコだよね～\nもっと感謝しろし～♪", "フブキ", 130211, 3003202, 1, 5.6, "2024/10/31 12:00:00", "2030/01/01 14:59:59", 202, 0.0, 3003, -416.5, 2);
